<script setup>
import   TheHeader   from '/components/TheHeader'
import   TheFooter   from '/components/TheFooter'
import   EBtn   from '/components/Base/E-btn'
import {useRoute} from "nuxt/app";
import {onBeforeMount, onMounted} from "vue";
  const props = defineProps(['error']);
  const route = useRoute();


const svg404 = ref(null);

const randInt = (min, max) => { // min and max included
  return Math.floor(Math.random() * (max - min + 1) + min)
}

onMounted(
    () => {
      const groupOfPaths = svg404.value.querySelectorAll('path');
      let initialDelay = 300;
      groupOfPaths.forEach((svgPath)=>{
        svgPath.style.opacity = 0
        // preset - 1
        // let randStartTranslateX = randInt(-150,150);
        // let randStartTranslateY = randInt(-150,150);
        //
        // let randStartScale = parseFloat(randInt(2,19)/10);


        // when x is gonnna down y gonna up
        // when y is gonnna down x gonna up

        // preset - 2
        // let offsettedInt = 0;
        // if(randInt(0,1) === 1 ){
        //   offsettedInt = -150;
        // }else{
        //   offsettedInt = 150;
        // }
        //
        // let randStartTranslateX = offsettedInt
        // let randStartTranslateY = -offsettedInt
        //
        // let randStartScale = 1;

        let offsettedInt = 0;
        if(randInt(0,1) === 1 ){
          offsettedInt = -150;
        }else{
          offsettedInt = 150;
        }

        let randStartTranslateX = offsettedInt + randInt(-5,5)
        let randStartTranslateY = -offsettedInt  + randInt(-5,5)

        let randStartScale = 1;

        const keyframes = [
          {
            transform : `translateX(${randStartTranslateX}px) translateY(${randStartTranslateY}px) scale(${randStartScale})`,
            opacity : 0
          },
          {
            transform : "translateX(0px) translateY(0px) scale(1)",
            opacity : 1,
          },
        ]
        // preset -1
        // const timings = {
        //   duration: randInt(500,1500),
        //   iterations: 1,
        // };

        // preset -2
        // const timings = {
        //   duration: 1000,
        //   iterations: 1,
        // };

        const timings = {
          duration: 500,
          delay : initialDelay,
          iterations: 1,
        };
        setTimeout(()=>{svgPath.style.opacity = 1}, initialDelay + 500)
        initialDelay += 15
        svgPath.animate(keyframes,timings)

      })
    }
)

