<style scoped>
.text-wrap-balance{
  text-wrap: balance;
}
#animate-it svg{
  overflow: visible;
}
.page{
&-wrapper{
   @apply flex flex-col;
   min-height:70vh;
 }
}
.content{
&-wrapper{
   @apply flex flex-col justify-center items-center overflow-hidden;
   min-height:80vh;
   padding-top : 90px;
   margin-bottom : 0 !important;
  background: linear-gradient(180deg, #DCF0FF 0%, #F0F3F5 100%);
 }
}
  .error{
    &__code{
      @apply text-[100px] md:text-[200px] lg:text-[340px]  my-8;
     }
     &__description{
      @apply   text-[15px] md:text-[30px];
      }
      &__debug-trace{
        @apply text-left text-[20px];
       padding:0 20px;
      margin: 30px 0;
       background:black;
       color: #2dff2d;
        pre{
          white-space: break-spaces;
        }
       }
  }
</style>
